export const APIs = () => {
  return (
    <Fragment>
      <div className='container'>
        <h1>
          <i className='fas fa-exclamation-triangle'></i> List of APIs
        </h1>
        <h5>Sorry, this hasn't been implemented yet.</h5>
      </div>
    </Fragment>
  );
};

export const randAPI = () => {
  const APIlist = 
    [
      'https://jsonplaceholder.typicode.com/posts',
      'https://cat-fact.herokuapp.com/facts'
    ]
    return 'https://cat-fact.herokuapp.com/facts';
}
